    """Find a small common multiple of two integers."""
    return n % a == 0 and n % b == 0 and 0 < n <= upper_bound

sols:
def sol(a=15, b=27, upper_bound=150):
    m, n = min(a, b), max(a, b)
    while m > 0:
        m, n = n % m, m
    return a * (b // n)

